import React from "react";
import { Route, Switch, Redirect } from "react-router-dom";
import CustomerApp from "./customerApp";
import SupplierApp from "./supplierApp";
import AdminApp from "./AdminApp";
import NotFound from "./notfound";
import LoginForm from "./loginForm";
import CreateAccount from "./createAccount";
import { ToastContainer } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import ForgotPassword from "./macroComponents/forgotPasswordForm";
import ProfileSetup from "./macroComponents/profileSetup";

function App() {
  return (
    <React.Fragment>
      <ToastContainer />
      <Switch>
        <Route
          path="/customer"
          exact
          render={(props) => <CustomerApp {...props} />}
        />
        <Route path="/profileSetUp">
          <ProfileSetup />
        </Route>
        <Route path="/supplier">
          <SupplierApp />
        </Route>
        <Route path="/admin">
          <AdminApp />
        </Route>
        <Route path="/login">
          <LoginForm />
        </Route>
        <Route path="/createAccount">
          <reateAccount />
        </Route>

        <Route path="/forgotPassword" exact component={ForgotPassword} />
        <Route path="/not-found" exact component={NotFound} />
        <Redirect path="/signIn" exact to="/login" />
        <Redirect path="/register" exact to="/createAccount" />
        <Redirect from="/" exact to="/login" />
        <Redirect to="/not-found" />
      </Switch>
    </React.Fragment>
  );
}

export default App;
